import React from "react";
import PropTypes from "prop-types";

import Content from "../Content";
import {
  Container,
  Search,
  Icon,
  Input,
  WrapperMenu,
  Menu,
  Label,
} from "./styles";

function List() {
  return (
    <Container>
      <Content>
        <Search>
          <Input placeholder="Filtrar" />
          <Icon />
        </Search>
        <WrapperMenu>
          {/* <Menu> */}
          {/* <Label selected>Todos</Label>
            <Label>Camisa</Label> */}
          {/* </Menu> */}
        </WrapperMenu>
      </Content>
    </Container>
  );
}

List.propTypes = {
  data: PropTypes.array,
};

List.defaultProps = {
  data: [],
};

export default List;
